import React from 'react';
import './App.css';
import MainPage from './Pages/MainPage.tsx'
import HomeP from './Pages/HomeP.tsx'
import ProfileP from './Pages/ProfileP.tsx'
import Register from './Pages/Register.tsx'
import {BrowserRouter, Switch, Route } from 'react-router-dom';
import {Links} from 'react-router-dom';

function App() {
  return (
    <BrowserRouter>
      <div className="App">  
      <MainPage path="/main" exact component={MainPage} />


        <HomeP path="/homeP" exact component={HomeP} />
        <ProfileP path="/profile" exact component={ProfileP} />
        <Register path="/register" exact component={Register} />

      </div>
    </BrowserRouter>
  );
}




export default App;
